    var getMeRandomItems = function(type, number) {

        function randOrd(){
            return (Math.round(Math.random())-0.5);
        }

        if(type == 'company') {
            return companies.sort(randOrd).splice(1, number);
        }

        if(type == 'country') {
            return countries.sort(randOrd).splice(1, number);
        }

        if(type == 'city') {
            return cities.sort(randOrd).splice(1, number);
        }

        if(type == 'employee') {
            return employees.sort(randOrd).splice(1, number);
        }
        
    };

